import { getEmployeeData } from '../data/employeeData';

function Card({employee}) {
  return (
    <div className="w-[460px] h-72 flex filter drop-shadow-2xl rounded-12">
        <img className='h-full w-52' src={employee.image} alt="doctorImage" />
        <div className="">
        <p>First Name: {employee.fname}</p>
        <p>Last Name: {employee.lname}</p>
        <p>Department: {employee.department}</p>
        <p>Language: {employee.language.join(', ')}</p>
        </div>
    </div>
  );
}

export default Card;
